import React from 'react'
import {Card} from './Card';
import painting from "../data/paintings";


export default class CardContainer extends React.Component {
    render() {
        return (
            <div className="row ml-3">
                <Card paintings = {painting.map(e => {<li>e</li>})}/>


            </div>
        )
    }
}
